package com.fulan.application.service.impl;import com.fulan.api.security.domain.AccountAgent;import com.fulan.application.mapper.AccountAgentMapper;import com.fulan.application.orm.id.GenerateVOUtil;import com.fulan.application.orm.id.IdGenerator;import com.fulan.application.service.AccountAgentService;import org.springframework.beans.factory.annotation.Autowired;import org.springframework.stereotype.Service;import org.springframework.transaction.annotation.Transactional;@Service@Transactionalpublic class AccountAgentServiceImpl implements AccountAgentService{	@Autowired	private AccountAgentMapper accountAgentMapper;	@Autowired	IdGenerator idGenerator;	public int deleteByPrimaryKey(String agentId){		return accountAgentMapper.deleteByPrimaryKey(agentId);	}	public int insert(AccountAgent record){		GenerateVOUtil.generate(record);		return accountAgentMapper.insert(record);	}	public AccountAgent selectByPrimaryKey(String agentId){		return accountAgentMapper.selectByPrimaryKey(agentId);	}}